import { Injectable } from '@angular/core';
import {Observable} from 'rxjs/Observable';
import 'rxjs/add/observable/of';

import { Group } from '../_models/group';

@Injectable()
export class GroupsService {
  
  groups: Group[] = [
    {
      id: 1, 
      name: 'K.S.V. st. Franciscus Xaverius',
      profileImage: 'data:image/png;base64,',
      parentGroup: null,
      subGroups: [
        {
          id: 2, 
          name: 'W.H.D The Knights of the Round Table',
          profileImage: 'data:image/png;base64,'
        },
        {
          id: 3, 
          name: 'Borrelpartij het Vijfjarenplan',
          profileImage: 'data:image/png;base64,'
        }
      ]
    },
    {
      id: 2, 
      name: 'W.H.D The Knights of the Round Table',
      profileImage: 'data:image/png;base64,',
      parentGroup: {
        id: 1, 
        name: 'K.S.V. st. Franciscus Xaverius',
        profileImage: 'data:image/png;base64,'
      },
      subGroups: []
    },
    {
      id: 3, 
      name: 'Borrelpartij het Vijfjarenplan',
      profileImage: 'data:image/png;base64,',
      parentGroup: {
        id: 1, 
        name: 'K.S.V. st. Franciscus Xaverius',
        profileImage: 'data:image/png;base64,'
      },
      subGroups: []
    }
    ];
    
  getGroups() : Observable<Group[]> {
    return Observable.of(this.groups);
  }
  
  getGroup(id: number) : Observable<Group> {
    return Observable.of(this.groups.find(group => group.id === id));
  }
  
  createGroup(group: Group): Observable<Group> {
    let maxId: number = Math.max(...this.groups.map(g => g.id));
    group.id = maxId + 1;
    if (!!group.parentGroup) {
      let index: number = this.groups.findIndex(g => g.id === group.parentGroup.id)
      this.groups[index].subGroups.push(group);
    }
    this.groups.push(group);
    return Observable.of(group);
  }
}